import React from "react";
import SideNavbar from "./SideNavbar";

const UserInput = ({ inputType, setInputType }) => {
  return (
    <div className="flex">
      <SideNavbar inputType={inputType} setInputType={setInputType} />
    </div>
  );
};

export default UserInput;
